let data={
    "id": 1,
    "page": "index",
    "asidedata": "notyet",
    "typedata": "all",
    "totalprice": 0,
    "order": []
}
let orderdata=[
    {
        "id": 1,
        "image": "data:image/jpeg;base64,",
        "mode": "today",
        "name": "今日特餐A",
        "price": 135
    },
    {
        "id": 2,
        "image": "data:image/jpeg;base64,",
        "mode": "today",
        "name": "今日特餐B",
        "price": 110
    },
    {
        "id": 3,
        "image": "data:image/jpeg;base64,",
        "mode": "toast",
        "name": "吐司A",
        "price": 110
    },
    {
        "id": 4,
        "image": "data:image/jpeg;base64,",
        "mode": "toast",
        "name": "吐司B",
        "price": 110
    },
    {
        "id": 5,
        "image": "data:image/jpeg;base64,",
        "mode": "burger",
        "name": "漢堡A",
        "price": 110
    },
    {
        "id": 6,
        "image": "data:image/jpeg;base64,",
        "mode": "burger",
        "name": "漢堡B",
        "price": 110
    }
]
let dbdata

function getdb(){
    let transaction=dbdata.transaction("data","readwrite")
    let objectstore=transaction.objectStore("data")
    let request=objectstore.get(1)

    request.onsuccess=function(event){ data=event.target.result;main() }
}

function updatedb(){
    let transaction=dbdata.transaction("data","readwrite")
    let objectstore=transaction.objectStore("data")
    let request=objectstore.put(data)

    request.onsuccess=function(event){ main() }
}

async function main(){
    if(data["page"]=="index"){
        document.getElementById("header").innerHTML=`
            <h1 id="logo">龍呷某飽尚厚來點餐</h1>
        `
        document.getElementById("main").innerHTML=`
            <div class="center" style="max-width: 20vw">
                <input type="text" name="table" placeholder="請輸入桌號">
                <input type="text" name="headcount" placeholder="請輸入人數">
            </div>
        `
        document.getElementById("aside").innerHTML=``
        document.getElementById("footer").innerHTML=`
            <button class="confirm" id="confirm">確定</button>
        `
        document.getElementById("main").classList.remove("haveaside")
        document.getElementById("aside").classList.remove("haveaside")

        document.getElementById("confirm").onclick=function(){
            data["page"]="order"
            updatedb()
        }
    }else if(data["page"]=="order"){
        let temporderdata=[...orderdata]
        let totalprice=0
        let maininnerhtml=``
        let asideinnerhtml=``

        console.log(data["typedata"])
        if(data["typedata"]!="all"){
            temporderdata=temporderdata.filter(function(event){ return event["mode"]==data["typedata"] })
        }
        for(let i=0;i<temporderdata.length;i=i+1){
            maininnerhtml=`
                ${maininnerhtml}
                <div class="menuitem">
                    <img src="${temporderdata[i]["image"]}" class="meal">
                    <div class="flex">
                        <div>
                            <div class="meal-name">${temporderdata[i]["name"]}</div>
                            <div class="meal-price">${temporderdata[i]["price"]}</div>
                        </div>
                        <button class="addmealbutton" data-id="${temporderdata[i]["id"]}" id="addMeal">+</button>
                    </div>
                </div>
            `
        }

        for(let i=0;i<data["order"].length;i=i+1){
            if(data["order"][i]["type"]=="notyet"){
                totalprice=totalprice+(data["order"][i]["count"]*orderdata[data["order"][i]["id"]-1]["price"])
            }
            if(data["asidedata"]=="notyet"&&data["order"][i]["type"]=="notyet"){
                asideinnerhtml=`
                    ${asideinnerhtml}
                    <li class="orderitem item">
                        <div class="flex">
                            <div class="name">${orderdata[data["order"][i]["id"]-1]["name"]}</div>
                            <div class="num">x${data["order"][i]["count"]}</div>
                        </div>
                        <div class="flex">
                            <div class="delete" data-id="${data["order"][i]["id"]}">刪除</div>
                            <div class="amount">$${data["order"][i]["count"]*orderdata[data["order"][i]["id"]-1]["price"]}</div>
                        </div>
                    </li>
                `
            }else if(data["asidedata"]=="yet"&&data["order"][i]["type"]=="yet"){
                asideinnerhtml=`
                    ${asideinnerhtml}
                    <li class="orderitem item">
                        <div class="flex">
                            <div class="name">${orderdata[data["order"][i]["id"]-1]["name"]}</div>
                            <div class="num">x${data["order"][i]["count"]}</div>
                        </div>
                        <div class="flex">
                            <div></div>
                            <div class="amount">$${data["order"][i]["count"]*orderdata[data["order"][i]["id"]-1]["price"]}</div>
                        </div>
                    </li>
                `
            }
        }

        data["totalprice"]=totalprice

        document.getElementById("header").innerHTML=`
            <h1 id="logo">龍呷某飽尚厚來點餐</h1>
            <form id="searchForm">
                <input type="text" name="search" placeholder="搜尋">
            </form>
            <button class="whitebutton" id="exit">離開點餐</button>
        `
        document.getElementById("main").innerHTML=`
            <ul class="categorylist list" id="category">
                <li class="item type" id="all">全部</li>
                <li class="item type" id="today">今日特餐</li>
                <li class="item type" id="toast">吐司</li>
                <li class="item type" id="burger">漢堡</li>
            </ul>
            <div class="menu" id="menu">
                ${maininnerhtml}
            </div>
        `
        document.getElementById("aside").innerHTML=`
            <div class="flex margin-5px_0px justifyContent-space-around">
                <button class="orderbutton" id="yetOrderBtn">未點</button>
                <button class="orderbutton" id="haveOrderedBtn">已點</button>
            </div>
        `
        document.getElementById("footer").innerHTML=`
            <div class="total-price">總計: ${data["totalprice"]} 元</div>
            <button class="orangebutton" id="checkout">結帳</button>
        `
        document.getElementById("main").classList.add("haveaside")
        document.getElementById("aside").classList.add("haveaside")

        document.getElementById(data["typedata"]).classList.add("active")

        if(data["asidedata"]=="notyet"){
            document.getElementById("yetOrderBtn").classList.add("active")
            document.getElementById("aside").innerHTML+=`
                <ul class="list" id="yetOrderList">
                    ${asideinnerhtml}
                </ul>
            `
        }else{
            document.getElementById("haveOrderedBtn").classList.add("active")
            document.getElementById("aside").innerHTML+=`
                <ul class="list" id="haveOrderedList">
                    ${asideinnerhtml}
                </ul>
            `
        }

        document.querySelectorAll(".addmealbutton").forEach(function(event){
            event.onclick=function(){
                let check=false
                for(let i=0;i<data["order"].length;i=i+1){
                    if(data["order"][i]["id"]==event.dataset.id&&data["order"][i]["type"]=="notyet"){
                        data["order"][i]["count"]=data["order"][i]["count"]+1
                        check=true
                    }
                }
                if(!check){
                    data["order"].push({
                        "id": event.dataset.id,
                        "count": 1,
                        "type": "notyet"
                    })
                }
                updatedb()
            }
        })

        document.querySelectorAll(".delete").forEach(function(event){
            event.onclick=function(){
                for(let i=0;i<data["order"].length;i=i+1){
                    if(data["order"][i]["id"]==event.dataset.id&&data["order"][i]["type"]=="notyet"){
                        data["order"].splice(i,1)
                        break
                    }
                }
                updatedb()
            }
        })

        document.querySelectorAll(".orderbutton").forEach(function(event){
            event.onclick=function(){
                if(event.id=="yetOrderBtn"){
                    data["asidedata"]="notyet"
                }else{
                    data["asidedata"]="yet"
                }
                updatedb()
            }
        })

        document.querySelectorAll(".categorylist li").forEach(function(event){
            event.onclick=function(){
                data["typedata"]=event.id
                updatedb()
            }
        })
        document.getElementById("checkout").onclick=function(){
            data["page"]="pay"
            updatedb()
        }
        document.getElementById("exit").onclick=function(){
            data={
                "id": 1,
                "page": "index",
                "asidedata": "notyet",
                "typedata": "all",
                "totalprice": 0,
                "order": []
            }
            updatedb()
        }
    }else if(data["page"]=="pay"){
        let maininnerhtml=``

        for(let i=0;i<data["order"].length;i=i+1){
            if(data["order"][i]["type"]=="notyet"){
                maininnerhtml=`
                    ${maininnerhtml}
                    <li class="orderitem item">
                        <div class="flex">
                            <div class="name">${orderdata[data["order"][i]["id"]-1]["name"]}</div>
                            <div class="num">x${data["order"][i]["count"]}</div>
                        </div>
                        <div class="flex">
                            <div></div>
                            <div class="amount">$${data["order"][i]["count"]*orderdata[data["order"][i]["id"]-1]["price"]}</div>
                        </div>
                    </li>
                `
            }
        }

        document.getElementById("header").innerHTML=`
            <h1 id="logo">龍呷某飽尚厚來點餐</h1>
            <form id="searchForm">
                <input type="text" name="search" placeholder="搜尋">
            </form>
            <button class="whitebutton" id="exit">離開點餐</button>
        `
        document.getElementById("main").innerHTML=`
            <h1>確認餐點</h1>
            <ul class="list" id="orderList">
                ${maininnerhtml}
            </ul>
            <div class="flex">
                <div></div>
                <span class="total">總計 ${data["totalprice"]} 元</span>
            </div>
        `
        document.getElementById("aside").innerHTML=``
        document.getElementById("footer").innerHTML=`
            <button class="orangebutton" id="return">返回點餐頁</button>
            <button class="orangebutton" id="byCash">現金付款</button>
        `
        document.getElementById("main").classList.remove("haveaside")
        document.getElementById("aside").classList.remove("haveaside")

        document.getElementById("return").onclick=function(){
            data["page"]="order"
            updatedb()
        }
        document.getElementById("byCash").onclick=function(){
            for(let i=0;i<data["order"].length;i=i+1){
                if(data["order"][i]["type"]=="notyet")
                    data["order"][i]["type"]="yet_temp"
            }
            data["page"]="finish"
            updatedb()
        }
        document.getElementById("exit").onclick=function(){
            data={
                "id": 1,
                "page": "index",
                "asidedata": "notyet",
                "typedata": "all",
                "totalprice": 0,
                "order": []
            }
            updatedb()
        }
    }else if(data["page"]=="finish"){
        let totalprice=0
        let maininnerhtml=``

        for(let i=0;i<data["order"].length;i=i+1){
            if(data["order"][i]["type"]=="yet_temp"){
                maininnerhtml=`
                    ${maininnerhtml}
                    <li class="orderitem item">
                        <div class="flex">
                            <div class="name">${orderdata[data["order"][i]["id"]-1]["name"]}</div>
                            <div class="num">x${data["order"][i]["count"]}</div>
                        </div>
                        <div class="flex">
                            <div></div>
                            <div class="amount">$${data["order"][i]["count"]*orderdata[data["order"][i]["id"]-1]["price"]}</div>
                        </div>
                    </li>
                `
            }
        }

        document.getElementById("header").innerHTML=`
            <h1 id="logo">龍呷某飽尚厚來點餐</h1>
            <form id="searchForm">
                <input type="text" name="search" placeholder="搜尋">
            </form>
            <button class="whitebutton" id="exit">離開點餐</button>
        `
        document.getElementById("main").innerHTML=`
            <h1>訂單成立</h1>
            <ul class="list" id="finishOrderList">
                ${maininnerhtml}
            </ul>
            <div class="flex">
                <div></div>
                <span class="total">總計 ${data["totalprice"]} 元</span>
            </div>
        `
        document.getElementById("aside").innerHTML=``
        document.getElementById("footer").innerHTML=`
            <div></div>
            <button class="orangebutton" id="continue">繼續點餐</button>
        `
        document.getElementById("main").classList.remove("haveaside")
        document.getElementById("aside").classList.remove("haveaside")

        document.getElementById("continue").onclick=function(){
            for(let i=0;i<data["order"].length;i=i+1){
                data["order"][i]["type"]="yet"
            }
            data["page"]="order"
            updatedb()
        }
        document.getElementById("exit").onclick=function(){
            data={
                "id": 1,
                "page": "index",
                "asidedata": "notyet",
                "typedata": "all",
                "totalprice": 0,
                "order": []
            }
            updatedb()
        }
    }
}


let request=indexedDB.open("data")

request.onsuccess=function(event){
    dbdata=event.target.result

    getdb()
}

request.onupgradeneeded=function(event){
    dbdata=event.target.result

    let objectstore=dbdata.createObjectStore("data",{ keyPath: "id" })
    objectstore.add(data)
}